import React, { Component } from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import '../TopNav/TopNav.css'
import hamburger from "../Resources/PinClipart.com_cempasuchil-clipart_1812493.png"

import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'
import Image from 'react-bootstrap/Image'


export default class TopNav extends Component {
    render() {
        return (
            <Navbar collapseOnSelect expand="xl" className="NavBar">
                {/* <Navbar.Brand href="#home" className="brand">Kanta Husari</Navbar.Brand> */}
                <h1 className="brand">Kanta Husari</h1>
                {/* <Navbar.Toggle aria-controls="responsive-navbar-nav" className="aria_controls" /> */}
                {/* <Navbar.Toggle className="aria_controls" /> */}
                {/* <Navbar.Collapse > */}
                {/* <Nav className="links">
                    <Link to="#features" className="link">Features</Link>
                    <Link to="#features" className="link">Features</Link>
                    <Link to="#features" className="link">Features</Link>
                    <Link to="#features" className="link">Features</Link>
                </Nav> */}
                {/* </Navbar.Collapse> */}
                <div  className='collapseButton'>
                    <Image src={hamburger} className='collapseButton'/>
                </div>

            </Navbar>
        )
    }
}
